description:
In Dog rush: Draw to save , your mission is to find the way to reach the dog house. Draw a line to connect dogs and their house. But how fastest you can go to help them out!

HOW TO PLAY:
It's time to stir your wild imagination:
1. Tap on the dogs to start drawing lines;
2. Draw a line to dog house and avoid obstacles on their way;
3. Find a fastest path to reach the destination
4. The dogs run to their house along the line, and the game is successful.

GAME FEATURE:
1. Rich maze graphics;
2. Lively and interesting characters;
3. The decompression and refreshing feeling of mission clearance;
4. Variety of levels: More than 99+ levels of increasing difficulty.
4. Time for your brain to refresh after a day

Learn to draw lines creatively, develop your sense of logic and improve your brain! Download now.

Save The Dog is a casual puzzle game. You draw lines with your fingers to create walls that protect the dog from attacks by bees in the hive. You need to protect the dog with the painted wall for 10 seconds during the attack of the bees, hold on and you will win the game. Use your brain to save the doge.

How to play:
1. Swipe the screen to create a wall to protect the dog;
2. As long as you don't let go, you can always draw the line;
3. You can let go after producing a satisfactory pattern;
4. Wait for the bees in the hive to attack;
5. Hold your wall for 10 seconds, so that the dog will not be attacked by bees;
6. You will win the game.

Game Features:
1. A variety of customs clearance methods;
2. Easy and funny customs clearance patterns;
3. Funny dog expressions;
4. Puzzle and interesting levels.
5. Various skins, you could save the chicken or save the sheep

Welcome to try our game, if you have any comments on the game, you can give feedback in the game, thank you for your feedback.
